import React from 'react';
import './NavMenuStyle.css';
import Link from "react-router-dom/Link";
import {useContext, useState} from "react";
import {AuthContext} from "../App";
import logoutLogo from '../img/logout.png'





function NavMenu() {


    const {isAuth, logout} = useContext(AuthContext)

    return (
        <div className="header">
            {/*<a href="#" className="header-logo"></a>*/}
            <nav>
                <ul className="header-nav">
                    <li><Link to={'/'}>Главная</Link></li>
                    <li><Link to={'/articles'}> Статьи</Link></li>
                    <li><Link to='/about'>Обо мне</Link></li>
                    <li><Link to={'/services'}>Услуги</Link></li>
                    {/* <li><Link to={'/private'}>TEST</Link></li> */}
                    {!isAuth && <li><Link to={'/registration'}>Войти</Link></li>}
                    {isAuth && <li><button onClick={logout}>Logout</button></li>}

                    {/* {!isAuth && <button><Link to={'/registration'}>TEST</Link></button>} */}
                </ul>
                {/* <img src={logoutLogo} alt="my image" onClick={login}/> */}
            </nav>
        </div>

    );
}

export default NavMenu;
